import { Button } from '@mui/base/Button';

function Seat({seatNum, data})
{
    const className = (data.available ? "border-solid border-teal-300 bg-transparent" :  "bg-teal-300") + "seat" + "rounded-md py-1 px-4..."

    return (
        <Button className="seat bg-green-600 rounded-md py-1 px-4...">{data.seatNum + 5}</Button>
    )
}

export default Seat;
